//import from './logo.svg';
import './App.css';
import Header from './Header';
import Home from './Home';
import { Route, Router } from 'react-router-dom';
import Checkout from './Checkout';
import React from 'react';

function App() {
  return (
    <div className="App">
      <Router>
          <Route path='/checkout'>
            <Header />
            <Checkout />
          </Route>
          <Route path='/'>
            <Header />
            <Home />
          </Route>
      </Router>
  </div>
  )
}

export default App;
